import React, { useState, useEffect } from 'react';

const DisplayData = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    try {
      const response = await fetch('/process_data.php?api=data');
      const jsonData = await response.json();
      setData(jsonData);
    } catch (error) {
      console.error('Error fetching data:', error);
    }
  };

  return (
    <div>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Record Type</th>
            <th>Main Point</th>
            <th>Sex</th>
            <th>Age</th>
            <th>Params</th>
            <th>IP</th>
            <th>Datetime</th>
            <th>Request Method</th>
            <th>URL</th>
            <th>Protocol</th>
            <th>Status Code</th>
            <th>Referrer</th>
            <th>User Agent</th>
          </tr>
        </thead>
        <tbody>
          {data.map((item) => (
            <tr key={item.id}>
              <td>{item.id}</td>
              <td>{item.record_type}</td>
              <td>{item.main_point}</td>
              <td>{item.sex}</td>
              <td>{item.age}</td>
              <td>{item.params}</td>
              <td>{item.ip}</td>
              <td>{item.datetime}</td>
              <td>{item.request_method}</td>
              <td>{item.url}</td>
              <td>{item.protocol}</td>
              <td>{item.status_code}</td>
              <td>{item.referrer}</td>
              <td>{item.user_agent}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default DisplayData;
